作業時にシワができにくく、貼った直後は貼り直しもＯＫ。<img src="http://image.rakuten.co.jp/cocodecow/cabinet/zaikocall.gif" width="303" height="100" border="0"><br />他の印刷物やフィルムとの表面どうしがくっつかないようにしてあります。※被着体によっては貼り直しができない場合があります。耐候性・耐老化性にすぐれたフィルムです。燃焼時に有毒ガスを発生しません。ラミネート加工していない再生可能なはく離紙を使用しています。●サイズ：幅３５０ｍｍ×長さ１．５ｍ●ロールタイプ●材質：基材／ポリプロピレン、粘着剤／アクリル系、はく離紙／ノンポリラミ紙<BR>●用途：辞書や資料図書の保護に。教科書や文集のカバーに。図面、ＰＯＰやポスターのカバーに。ロードマップ、登山地図の保護に。楽譜のカバーに。学級新聞の保護に。押し花のコーティングに。倉庫棚の名札の保護に。屋内のガラスの補修に。（屋内で１か月程度の短期間に限定）。配電盤やスイッチ盤の保護に。<BR><BR><BR><BR><BR>にちばん　ＮＩＣＨＩＢＡＮ　かばーふぃるむ　ＣＦ－３５０Ｒ　ＣＦ３５０Ｒ　製本用品　製本テープ　製本カバー　教科書　テキスト　ノート　保護　ブックカバー　辞書　図面　ＰＯＰ　地図　ガラス<style type="text/css">
